import './App.css';
import Post from './Post';

function App() {
  return (
    <main>
      <header>
        <a href="https://ya.ru" className="logo"> YaBlog </a>
        <nav>
          <a href="">Login</a>
          <a href="">Register</a>
        </nav>
      </header>

      <Post />
      <Post />
      <Post />

   
    </main>

  );
}

export default App;
